  \"2016-07-27T22:45:33.718562\",\n\t\"name\": \"crescent-lake-national-wildlife-refuge-quarterly-narrative-report-february-march-and-apri-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from February through April
  of 1941. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, predators, and reptiles- is also covered. The Refuge
  development and maintenance section discusses physical developments. Resource management
  is outlined; topics include grazing and haying. A short narrative on the North Platte
  Refuge is included. Photographs are attached.\",\n\t\"license_title\": \"License
